import React from 'react';
function App() {

  return (
    <div className="App" bgcolor="blue">
      <h1>Crypto Values</h1>
      <table>
        <tr><th align="right">Crypto Code</th>
          <input name="crypto_name"></input><br />
        </tr>
        <tr>
          <th align="right">Currency</th> <input name="currency"></input><br />
        </tr>
        <tr><input type="button" value="Submit" name="submit"></input>
          <input type="button" value="Cancel" name="Cancel"></input>
        </tr>
      </table>
    </div>
  );
}

export default App;
